import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const [clicked, setClicked] = useState();
  const btnClickHandler = () => { 
    alert("Button clicked") 
  }
  return (
    <div className="App">
      <div className="App-wrapper">
        { clicked ? <h1>Button clicked</h1> : null}
        <button className="App-click-btn" onClick = {btnClickHandler}>Click</button>
      </div>
    </div>
  );
}

export default App;
